import LoginUserField from './LoginUserField';
import LoginPasswordField from './LoginPasswordField';

export default function Login(){
    return(
        <div>
            <h1>KeepItSafe</h1>
            <LoginUserField />
            <LoginPasswordField />        
        </div>
    );
};
